import React from "react";
import Footer from '../components/Footer.js';
import AssetPoolSection from "../components/AssetPoolSection.js";
import { Button, Container  } from "shards-react";
import Layout from '../components/Layout.js';
import { Link } from '../../routes';


import { DrizzleProvider } from "@drizzle/react-plugin";
import { LoadingContainer } from "@drizzle/react-components";
import store from '../EthComponents/middleware';
import drizzleOptions from "../EthComponents/drizzleOptions";
import DrizzleContainer from '../EthComponents/DrizzleContainer.js';


export default class AssetPool extends React.Component {

render() {
    return (    
            
            <div>
              <Layout />
                <AssetPoolSection />

          <DrizzleProvider store={store} options={drizzleOptions}>
            <LoadingContainer>
                <DrizzleContainer />
            </LoadingContainer>
          </DrizzleProvider>
              <Footer />   
            </div>
       
        );
    }

}
